import Hint from "../../comment/Hint";
import DialogBar from "../../comment/DialogBar";
import Loading from "../../comment/Loading";
import { Decrypt, Encrypt } from "../../../utils";
export default {
  name: "ApplyFor",
  data: function data() {
    return {
      money: "",
      isShowDialog: false,
      DialogContent: "",
      showLoading: false,
      goToLogin: false
    };
  },
  components: {
    Hint: Hint,
    Loading: Loading,
    DialogBar: DialogBar
  },
  props: {
    mycase: Object
  },
  methods: {
    searchClick: function searchClick() {
      var self = this;

      if (self.money.length == 0 || parseInt(self.money) > parseInt(self.mycase.overdueMoney) + parseInt(self.mycase.interest) + parseInt(self.mycase.penalty) + (self.mycase.damages == null ? 0 : parseInt(self.mycase.damages))) {
        self.DialogContent = "请输入有效金额";
        self.isShowDialog = true;
      } else {
        self.showLoading = true;
        var param = {
          caseSubId: self.mycase.caseSubId,
          applyMoney: self.money,
          applyWay: "APP"
        };
        var params = JSON.stringify(param);
        var encrypt = Encrypt(params);
        self.$axios({
          method: "POST",
          url: "/api/ace-app/holdApply/rmasApplyCheck",
          data: {
            params: encrypt,
            userId: localStorage.userId,
            token: localStorage.token
          }
        }).then(function (response) {
          self.showLoading = false;
          console.log(response);
          var data = response.data;
          var message = data.data;

          if (message == "success") {
            self.passClick();
          } else if (message.code == "duplicateLogin") {
            self.DialogContent = "用户已在另一设备上登录，请在此设备上重新登录";
            self.isShowDialog = true;
            self.goToLogin = true;
          } else if (message == "apply") {
            self.DialogContent = "已提交过代扣申请，请等待上次申请的审核结果";
            self.isShowDialog = true;
          }
        }).catch(function (error) {
          console.log(error);
          self.DialogContent = "系统繁忙，请稍等";
          self.isShowDialog = true;
          self.unPassClick();
        });
      }
    },
    passClick: function passClick() {
      this.$router.push({
        name: "result",
        params: {
          isSucc: true,
          fromRouter: "applyFor"
        }
      });
    },
    unPassClick: function unPassClick() {
      this.$router.push({
        name: "result",
        params: {
          isSucc: false,
          fromRouter: "applyFor"
        }
      });
    },
    cancel: function cancel() {
      this.isShowDialog = false;

      if (this.goToLogin) {
        var len = history.length;
        this.$router.go(-(len - 1));
      }
    }
  }
};
